import React from 'react';
import './Carousel.css';

class Carousel extends React.Component {
  constructor(props) {
    super(props);
    this.state = {}
  }
  render() {
    return (
      <div style={this.props.settings.style} className='carousel_inner'>
        <div className='carousel_wrapper'>

        </div>
      </div>
    )
  }
}

export default Carousel
